description:
Prohibition. A gang war is raging over whiskey. A U.S. Marshall is killed...
When a local finds a bullet and some bones up in the hills, detective Michael Scorpio has nothing to go on. He sees a story on TV about a psychic and decides to let her try and get the investigation started. She picks up a feeling right away. Chloe sees a bloody gun battle between rival bootlegger gangs. Chloe and Michael hit it off. During their dialog over dinner, Chloe is struck by a flashback vision. It's a tryst between Olivia Del Rio and Dillon Day. She give him a nice looking blowjob and then lifts her dress for some hot fucking. It ends with her taking a nice shot on the face.

